// ==UserScript==
// @name         Sickrage Completed Hider
// @namespace    http://joshuaarus.fr
// @version      0.1
// @description  Hide already completed (progress bar at 100%) tx shows on main page
// @author       Arus Joshua
// @match        http://sr.joshuaarus.fr/home/
// @match        http://sickrage.joshuaarus.fr/home/
// @match        http://localhost:32145/home/
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    // CONSTANTS

    var IMG_DISABLED = "data:image/png;base64,";
    var IMG_ACTIVATED = "data:image/png;base64,";

    var COOKIE_NAME = "sickrageCompletedHider";
    var HIDE = false;
    var DEFAULT_DISPLAY = null;

    // FUNCTIONS

    var setCookie = function(cvalue) {
        var d = new Date();
        d.setTime(d.getTime() + (60 * 24 * 60 * 60 * 1000));
        var expires = "expires="+d.toUTCString();
        document.cookie = COOKIE_NAME + "=" + cvalue + ";" + expires + ";path=/";
    }

    var getCookie = function() {
        var name = COOKIE_NAME + "=";
        var decodedCookie = decodeURIComponent(document.cookie);
        var ca = decodedCookie.split(';');
        for(var i = 0; i <ca.length; i++) {
            var c = ca[i];
            while (c.charAt(0) == ' ') {
                c = c.substring(1);
            }
            if (c.indexOf(name) === 0) {
                return c.substring(name.length, c.length);
            }
        }
        return "";
    }

    var getButtonIcon = function() {
        return HIDE ? IMG_ACTIVATED : IMG_DISABLED;
    }

    var displayOrHide = function() {
        var completedShows = document.getElementsByClassName("ui-progressbar-complete");
        for (var i = 0;i < completedShows.length;i++){
            var show = completedShows[i].parentElement.parentElement.parentElement;

            if (DEFAULT_DISPLAY == null) {
                DEFAULT_DISPLAY = show.style.display;
            }

            show.style.display = HIDE ? "none" : DEFAULT_DISPLAY;
        }
    };

    HIDE = getCookie() === "true";

    var img = document.createElement('img');
    img.src = getButtonIcon();

    var aImg = document.createElement("a");
    aImg.href = "";
    aImg.onclick = function() {
        HIDE = !HIDE;
        setCookie(HIDE ? "true" : "false");
        displayOrHide();
        img.src = getButtonIcon();
        return false;
    }

    buttonBar.insertBefore(divHide, buttonBar.firstChild);

	// AUTOMATIC UPDATE OF THE PAGE

    setInterval(function(){
        displayOrHide();
    }, 1000);

})();